import React from 'react';
import Header from './Header';
import QuestionsContainer from './QuestionsContainer'

class App extends React.Component {

  constructor(){
    super()
    this.state={
      score: 0
    }
  }

  render (){
    return (
      <div>
        <p>Lutrivia</p>
        <Header />
        <QuestionsContainer/>
      </div>
    );
  }
}
export default App;
